public class Board {

    public Field[][] myBoard = new Field[8][8];
    public Field[] kingPlace = new Field[8];
    public Field[][] trashPlace = new Field[8][2];
    public Analyze analyzeFunctions;

    public Communication informer;

    char myPeasentColor, myKingColor, opponentPeasentColor, opponentKingColor;

    public Board(RemoteNXTFunctions remoteFunc)
            throws InterruptedException, IOException {
        informer = new Communication(remoteFunc);
        analyzeFunctions = new Analyze(this, remoteFunc);
        analyzeFunctions.findMyColors();
        findOpponentColors();

        int x, y;

        //Create the 8 times 8 board
        for (x = 0; x < 8; x++) {
            for (y = 0; y < 8; y++) {
                Field temp = new Field();
                temp.x = x;
                temp.y = y;

                //Every second field is an allowed field
                //latex start ConstructorLoop
                if ((x + y) % 2 == 1) {
                    temp.allowedField = true;
                    Piece pieceOnBoard = null;
                    if (y < 3) {
                        pieceOnBoard = new Piece(this);
                        pieceOnBoard.color = myPeasentColor;

                        //Every piece on the front line of each player
                        //is moveable from the start
                        if (y == 2) {
                            pieceOnBoard.isMoveable = true;
                        }
                    }
                    //latex end

                    if (y > 4) {
                        pieceOnBoard = new Piece(this);
                        pieceOnBoard.color = opponentPeasentColor;
                        if (y == 5) {
                            pieceOnBoard.isMoveable = true;
                        }
                    }
                    temp.setPieceOnField(pieceOnBoard);
                } else {
                    temp.allowedField = false;
                }
                myBoard[x][y] = temp;
            }
        }

        //Set the location of the human players king pieces
        //And Trashfield
        //latex start ConstructorKing
        for (int i = 0; i < 8; i++) {
            Field temp = new Field();
            temp.x = i;
            temp.y = -2;
            Piece tempPiece = new Piece(this);
            tempPiece.color = opponentKingColor;
            tempPiece.isCrowned = true;
            temp.setPieceOnField(tempPiece);
            kingPlace[i] = temp;
        }
        //latex end
        for (int j = 0; j < 2; j++) {
        for (int i = 0; i < 8; i++) {
            Field temp = new Field();
            temp.x = i;
            temp.y = -3 - j;
            trashPlace[i][j] = temp;
        }
        }
    }

    public final void resetVisited() {
        for (Field[] f : myBoard) {
            for (Field field : f) {
                field.visited = false;
            }
        }
    }

    //Sorts the list of fields to search to minimize robot movement
    public final void sortListOfFields(List<Field> listOfFields) {
        int x = 0;
        int y = 0;
        int sizeOflistOfFields = listOfFields.size();
        for (int i = 0; i < sizeOflistOfFields; i++) {
            for (int n = i + 1; n < sizeOflistOfFields; n++) {
                if (!isGreater(listOfFields.get(i),
                        listOfFields.get(n), x, y)) {
                    Field temp1 = listOfFields.get(i);
                    Field temp2 = listOfFields.get(n);
                    listOfFields.remove(n);
                    listOfFields.remove(i);
                    listOfFields.add(i, temp2);
                    listOfFields.add(n, temp1);
                }
            }
            x = listOfFields.get(i).x;
            y = listOfFields.get(i).y;
        }
    }

    //Sorts the list of fields to search to minimize robot movement
        public final void sortListOfMoves(List<Move> listOfMoves) {
            int x = 0;
            int y = 0;
            for (int i = 0; i < listOfMoves.size(); i++) {
                for (int n = i + 1; n < listOfMoves.size(); n++) {
                    if (!isGreater(listOfMoves.get(i).moves.get(
                        listOfMoves.get(i).moves.size() - 1),
                            listOfMoves.get(n).moves.get(
                                listOfMoves.get(n).moves.size() - 1), x, y)) {
                        Move temp1 = listOfMoves.get(i);
                        Move temp2 = listOfMoves.get(n);
                        listOfMoves.remove(n);
                        listOfMoves.remove(i);
                        listOfMoves.add(i, temp2);
                        listOfMoves.add(n, temp1);
                    }
                }
                x = listOfMoves.get(i).moves.get(
                        listOfMoves.get(i).moves.size() - 1).x;
                y = listOfMoves.get(i).moves.get(
                        listOfMoves.get(i).moves.size() - 1).y;
            }
        }
    //Method to used in sorting the list of places to move the robot
    public final boolean isGreater(Field inputField,
            Field fieldToCompare, int compX, int compY) {
        //Check jumps to be crowned first
        if (inputField.getPieceOnField().canJump
                && !inputField.getPieceOnField().isCrowned
                && inputField.getPieceOnField().color == opponentPeasentColor
                && inputField.getPieceOnField().getY() == 2) {
            return true;
        } else if (inputField.getPieceOnField().canJump
                && !fieldToCompare.getPieceOnField().canJump) {
            return true;
        } else if (fieldToCompare.getPieceOnField().canJump
                && !inputField.getPieceOnField().canJump) {
            return false;
        } else {
            if (inputField.y == 1 && fieldToCompare.y != 1
                    && !inputField.getPieceOnField().isCrowned) {
                return true;
            } else if (fieldToCompare.y == 1 && inputField.y != 1
                    && !fieldToCompare.getPieceOnField().isCrowned) {
                return false;
            } else {
                if (weight(inputField, compX, compY)
                    > weight(fieldToCompare, compX, compY)) {
                    return false;
                } else if (weight(inputField, compX, compY)
                           < weight(fieldToCompare, compX, compY)) {
                    return true;
                } else {
                    return (inputField.y < fieldToCompare.y);
                }
            }
        }
    }

    private int weight(Field inputField, int x, int y) {
        return Math.abs(inputField.x - x) + Math.abs(inputField.y - y);
    }

    public final boolean verifyOpPieceIsOnField(Field field) throws
    InterruptedException, IOException {
        if (checkAllegiance(field, true)) {
            if (field.getPieceOnField().isMoveable) {
                return !(isFieldEmptyOnBoard(field.x, field.y));
            }
        }
        return true;
    }

    public final boolean peasentIsOnEndRow(Field field) {
        if (!field.isEmpty()) {
            int checkRow;
            if (checkAllegiance(field, true)) {
                checkRow = 0;
            } else {
                checkRow = 7;
            }

            if (field.y == checkRow && !field.getPieceOnField().isCrowned) {
                return true;
            }
        }
        return false;
    }

    //Moves a piece in the board representation
    public final void movePieceInRepresentation(Field fromField, int toFieldX,
            int toFieldY, boolean isSimulated) throws NoKingLeft, IOException {
        movePieceInRepresentation(fromField,
                myBoard[toFieldX][toFieldY], isSimulated);
    }
    //latex start movePieceInRepresentation
    public final void movePieceInRepresentation(Field fromField,
            Field toField, boolean isSimulated) throws NoKingLeft, IOException {
        toField.setPieceOnField(fromField.getPieceOnField());
        fromField.emptyThisField();
        if (checkBounds(toField.x, toField.y)) {
            analyzeFunctions.checkForUpgradeKing(
                    toField, isSimulated);
        }
        //latex end
    }

    //Check if field has been occupied
    public final boolean checkMoveDirection(Field field,
            int directX, int directY) throws InterruptedException, IOException {
        return (!fieldOccupied(field.x + directX, field.y + directY)
            && !this.isFieldEmptyOnBoard(field.x + directX, field.y + directY));
    }

    public final boolean isFieldEmptyOnBoard(int x, int y)
            throws InterruptedException, IOException {
        if (checkBounds(x, y)) {
            char color = analyzeFunctions.getColor(x, y);

            return color == ' ';
        } else {
            return false;
        }
    }

    public final boolean fieldOccupied(int x, int y) {
        if (checkBounds(x, y)) {
            return !myBoard[x][y].isEmpty();
        } else {
            return true;
        }
    }

    //Check if a piece can move and is jumpable
    //latex start checkPiece
    private void checkPiece(Field field, int dify, boolean checkForOpponent) {
        field.getPieceOnField().canJump = checkJump(field,
                checkForOpponent, field.getPieceOnField().isCrowned);

        if (field.getPieceOnField().canJump) {
            field.getPieceOnField().isMoveable = true;
        } else {
            field.getPieceOnField().isMoveable =
                    checkMoveableBoolean(field, dify);
        }
    }
    //latex end

    private boolean checkMoveableBoolean(Field field, int dif) {
        return !checkMoveable(field, dif).isEmpty();
    }

    //Checks if a given field is movable
    public final List<Field> checkMoveable(Field field, int dif) {
        List<Field> possibleMoves = new ArrayList<Field>();

        //Check forward
        if (!this.fieldOccupied(field.x - 1, field.y + dif)) {
            possibleMoves.add(myBoard[field.x - 1][field.y + dif]);
        }
        if (!this.fieldOccupied(field.x + 1, field.y + dif)) {
            possibleMoves.add(myBoard[field.x + 1][field.y + dif]);
        }
        //if king, check backwards also
        if (field.getPieceOnField().isCrowned) {
            if (!this.fieldOccupied(field.x - 1, field.y - dif)) {
                possibleMoves.add(myBoard[field.x - 1][field.y - dif]);
            }
            if (!this.fieldOccupied(field.x + 1, field.y - dif)) {
                possibleMoves.add(myBoard[field.x + 1][field.y - dif]);
            }
        }
        return possibleMoves;
    }

    //Check if a given field can jump
    //latex start checkJump
    private boolean checkJump(Field field,
            boolean checkForOpponent, boolean isCrowned) {
        return (checkJumpDirectionBoolean(field, -1, -1,
                        checkForOpponent, isCrowned)
                || checkJumpDirectionBoolean(field, 1, -1,
                        checkForOpponent, isCrowned)
                || checkJumpDirectionBoolean(field, 1, 1,
                        checkForOpponent, isCrowned)
                || checkJumpDirectionBoolean(field, -1, 1,
                        checkForOpponent, isCrowned));
    }
    //latex end

    //Checks jumps
    //latex start jumpDirection
    public final Field checkJumpDirection(Field field, int difx, int dify,
            boolean checkForOpponent, boolean isCrowned) {
        if (((checkForOpponent && dify == -1)
                || (!checkForOpponent && dify == 1)) && !isCrowned) {
            return null;
        }

        if (checkBounds(field.x + 2 * difx, field.y + 2 * dify)) {
            if (!myBoard[field.x + 2 * difx][field.y + 2 * dify].visited) {
                if (checkAllegiance(
                      myBoard[field.x + difx][field.y + dify], checkForOpponent)
                      && !this.fieldOccupied(
                      field.x + 2 * difx, field.y + 2 * dify)) {
                    return myBoard[field.x + 2 * difx][field.y + 2 * dify];
                }
            }
        }
        return null;
    }
    //latex end

    private boolean checkJumpDirectionBoolean(Field field,
            int difx, int dify, boolean checkForOpponent, boolean isCrowned) {
        return !(checkJumpDirection(field, difx, dify,
                checkForOpponent, isCrowned) == null);
    }

    //Updates the movable property on each piece
    public final void updateMoveables() {
        resetVisited();
        for (Field[] f : myBoard) {
            for (Field field : f) {
                if (field.allowedField) {
                    if (field.getPieceOnField() != null) {
                        //Check movable for robot
                        if (checkAllegiance(field, false)) {
                            checkPiece(field, 1, true);

                        //Check movable for human
                        } else if (checkAllegiance(field, true)) {
                            checkPiece(field, -1, false);
                        }
                    }
                }
            }
        }
        resetVisited();
    }

    //Sets the colors of the human players pieces
    private void findOpponentColors() {
        if (myPeasentColor == 'r') {
            opponentPeasentColor = 'w';
            opponentKingColor = 'g';
        } else {
            opponentPeasentColor = 'r';
            opponentKingColor = 'b';
        }
    }


    //if a piece is missing, scan whole board
    public final void findMissingPiece()
            throws InterruptedException, IOException {
        int i, j;
        boolean changer = true;

        for (i = 0; i < 8; i++) {
            //Change direction of the robot, to minimize robot movement
            if (changer) {
                for (j = 0; j < 8; j++) {
                    if ((i + j) % 2 == 1) {
                        myBoard[i][j].setPieceOnField(getPiece(i, j));
                    }
                }
                changer = false;
            } else {
                for (j = 7; j >= 0; j--) {
                    if ((i + j) % 2 == 1) {
                        myBoard[i][j].setPieceOnField(getPiece(i, j));
                    }
                }
                changer = true;
            }
        }

        this.updateMoveables();
    }

    //Get piece on given position
    private Piece getPiece(int x, int y) throws IOException {
        char color = analyzeFunctions.getColor(x, y);
        if (color == ' ') {
            return null;
        } else {
            Piece temp = new Piece(this);
            temp.color = color;
            temp.isCrowned = (color == 'g' || color == 'b');
            return temp;
        }
    }

    //Check if a given piece is the robots or the opponents
   /*public final boolean checkAllegiance(Field input, boolean checkForOpponent)
    {
        if (checkBounds(input.x, input.y)) {
                if ((input.isPieceOfColor(myPeasentColor)
                    || input.isPieceOfColor(myKingColor))&& !checkForOpponent) {
                     return true;
                 }
                 if ((input.isPieceOfColor(opponentPeasentColor)
                         || input.isPieceOfColor(opponentKingColor))
                         && checkForOpponent) {
                     return true;
                 }
                 return false;
                 }
        return false;
    }*/
    public final boolean checkAllegiance(Field input, boolean checkForOpponent)
    {
        if (checkBounds(input.x, input.y)) {
            if (!input.isEmpty()) {
                return checkAllegiance(input.getPieceOnField(),
                        checkForOpponent);
            }
        }
        return false;
    }

    public final boolean checkAllegiance(Piece input, boolean checkForOpponent)
    {
        if ((input.color == myPeasentColor
                || input.color == myKingColor) && !checkForOpponent) {
             return true;
         }
         if ((input.color == opponentPeasentColor
                 || input.color == opponentKingColor)
                 && checkForOpponent) {
             return true;
         }
         return false;
    }

    //Return true if the given position is inbounds
    public final boolean checkBounds(int x, int y) {
        return x >= 0 && x <= 7 && y >= 0 && y <= 7;
    }
}

package com.OriginalFiles;

import java.awt.Color;
import java.io.IOException;
import java.util.ArrayList;
import java.util.List;

import custom.Exceptions.IllegalMove;
import custom.Exceptions.NoKingLeft;

public class Analyze {
    private Board checkersBoard;

    private Field fieldToCheck;
    private int analyzeBoardRepeatNumber = 0;
    private int totalAnalyzeRuns = 0;
    private final int analyzeRunsBeforeReset = 10;
    private RemoteNXTFunctions remoteFunctions;
    private Field trashField = new Field(3, -6);
    private boolean pieceFound;
    private boolean mustJump;

    public Analyze(Board input, RemoteNXTFunctions remoteInput) {
        checkersBoard = input;
        remoteFunctions = remoteInput;
    }

    //Analyzes the current board setup
    //latex start analyseBoard
    public final boolean analyzeBoard() throws InterruptedException,
    IOException, NoKingLeft, IllegalMove {
        if (!checkForGameHasEnded(true)) {
            checkMotorCalibration();

            List<Field> moveableList = new ArrayList<Field>();
            moveableList = makeListOfMoveables(moveableList);
            pieceFound = checkMovement(moveableList);
            countDownToPanic();

            //Find the pieces that are currently movable
            checkersBoard.updateMoveables();
            checkRobotPieceReplaced();
            if (!checkForGameHasEnded(false)) {
                return true;
            }
        }
        return false;
    }
    //latex end

    private void checkMotorCalibration() {
        totalAnalyzeRuns += 1;

        if (totalAnalyzeRuns > analyzeRunsBeforeReset) {
            totalAnalyzeRuns = 0;
            remoteFunctions.resetMotors();
        }
    }

    private List<Field> makeListOfMoveables(List<Field> moveableList) {
        //Find the pieces that are currently movable
        checkersBoard.updateMoveables();
        for (Field[] f : checkersBoard.myBoard) {
            for (Field field : f) {
                if (!field.isEmpty()) {
                    if (field.getPieceOnField().isMoveable
                            && checkersBoard.checkAllegiance(field, true)) {
                        moveableList.add(field);
                    }
                }
            }
        }
        checkersBoard.sortListOfFields(moveableList);
        pieceFound = false;
        mustJump = false;
        if (moveableList.size() != 0) {
            mustJump = moveableList.get(0).getPieceOnField().canJump;
        }
        return moveableList;
    }
    //latex start checkMovement
    private boolean checkMovement(List<Field> moveableList)
            throws IllegalMove, InterruptedException, IOException, NoKingLeft {
        for (Field field : moveableList) {
            if (checkersBoard.isFieldEmptyOnBoard(field.x, field.y)) {
                if (mustJump && !field.getPieceOnField().canJump) {
                    throw new custom.Exceptions.IllegalMove();
                }
                if (this.trackMovement(field)) {
                    return true;
                }
            }
        }
        return false;
    }
    //latex end
    //latex start countDownToPanic
    private void countDownToPanic()
            throws InterruptedException, IOException, NoKingLeft, IllegalMove {
        if (!pieceFound) {
            if (analyzeBoardRepeatNumber < 3) {
                analyzeBoardRepeatNumber++;
                analyzeBoard();
                analyzeBoardRepeatNumber = 0;
            } else if (analyzeBoardRepeatNumber < 6) {
                remoteFunctions.resetMotors();
                analyzeBoardRepeatNumber++;
                analyzeBoard();
                analyzeBoardRepeatNumber = 0;
            } else {
                checkersBoard.findMissingPiece();
            }
        }
    }
    //latex end

    //Try to find the piece that have been moved
    private boolean trackMovement(Field field) throws IllegalMove,
    InterruptedException, IOException, NoKingLeft {
        boolean foundPiece = false;
        if (field.getPieceOnField().canJump) {
            if (findJumpPiece(field)) {
                foundPiece = true;
            }
            if (!foundPiece) {
                throw new custom.Exceptions.IllegalMove();
            }
        } else if (checkMove(field, -1)) {
            foundPiece = true;
        }

        return foundPiece;
    }

    //Determine simple move
    private boolean checkMove(Field field, int directY) throws
    InterruptedException, IOException, NoKingLeft {
        //Verify that the given field is inbound
        if (checkersBoard.checkBounds(field.x, field.y)) {
            //Check the first direction
            if (checkersBoard.checkMoveDirection(field, 1, directY)) {
                if (validateMove(checkersBoard.
                        myBoard[field.x + 1][field.y + directY], field)) {
                    checkersBoard.movePieceInRepresentation(field,
                            field.x + 1, field.y + directY, false);
                    return true;
                } else {
                    return false;
                }
                //Second direction
            } else if (checkersBoard.checkMoveDirection(field, -1, directY)) {
                if (validateMove(checkersBoard.
                        myBoard[field.x - 1][field.y + directY], field)) {
                    checkersBoard.movePieceInRepresentation(field,
                            field.x - 1, field.y + directY, false);
                    return true;
                } else {
                    return false;
                }
                //If king, also check backwards
            } else if (field.getPieceOnField().isCrowned) {
                if (checkersBoard.checkMoveDirection(field, 1, -directY)) {
                    if (validateMove(checkersBoard.
                            myBoard[field.x + 1][field.y - directY], field)) {
                        checkersBoard.movePieceInRepresentation(field,
                                field.x + 1, field.y - directY, false);
                        return true;
                    } else {
                        return false;
                    }
                } else if (checkersBoard.checkMoveDirection(
                        field, -1, -directY)) {
                    if (validateMove(checkersBoard.
                            myBoard[field.x - 1][field.y - directY], field)) {
                        checkersBoard.movePieceInRepresentation(field,
                                field.x - 1, field.y - directY, false);
                        return true;
                    } else {
                        return false;
                    }
                }
            }
        }
        return false;
    }

    //Checks if it could have been another piece that moved
    private boolean validateMove(Field field, Field fromField) throws
    InterruptedException, IOException {

        List<Field> checkArray = new ArrayList<Field>();
        if (checkersBoard.checkBounds(field.x + 1, field.y + 1)) {
            checkArray.add(checkersBoard.myBoard[field.x + 1][field.y + 1]);
        }
        if (checkersBoard.checkBounds(field.x + 1, field.y - 1)) {
            checkArray.add(checkersBoard.myBoard[field.x + 1][field.y - 1]);
        }
        if (checkersBoard.checkBounds(field.x - 1, field.y - 1)) {
            checkArray.add(checkersBoard.myBoard[field.x - 1][field.y - 1]);
        }
        if (checkersBoard.checkBounds(field.x - 1, field.y + 1)) {
            checkArray.add(checkersBoard.myBoard[field.x - 1][field.y + 1]);
        }
        boolean returnValue = true;
        for (int i = 0; i < checkArray.size(); i++) {
            if (!(checkArray.get(i).x == fromField.x
                    && checkArray.get(i).y == fromField.y)) {
                returnValue = checkersBoard.verifyOpPieceIsOnField(
                        checkArray.get(i));
            }
            if (!returnValue) {
                return returnValue;
            }
        }
        return returnValue;
    }

    public final List<List<Field>> jumpSequence(Field input,
            boolean checkForOpponent, boolean isCrowned) throws
            InterruptedException, IOException, NoKingLeft {
        input.visited = true;
        List<List<Field>> returnList = new ArrayList<List<Field>>();
        Field tempField = checkersBoard.checkJumpDirection(input,
                -1, 1, checkForOpponent, isCrowned);
        if (tempField != null) {
            returnList.addAll(jumpSequence(tempField, checkForOpponent,
                    isCrowned));
        }
        tempField = checkersBoard.checkJumpDirection(input,
                -1, -1, checkForOpponent, isCrowned);
        if (tempField != null) {
            returnList.addAll(jumpSequence(tempField, checkForOpponent,
                    isCrowned));
        }
        tempField = checkersBoard.checkJumpDirection(input,
                1, -1, checkForOpponent, isCrowned);
        if (tempField != null) {
            returnList.addAll(jumpSequence(tempField, checkForOpponent,
                    isCrowned));
        }
        tempField = checkersBoard.checkJumpDirection(input, 1, 1,
                checkForOpponent, isCrowned);
        if (tempField != null) {
            returnList.addAll(jumpSequence(tempField, checkForOpponent,
                    isCrowned));
        }

        if (returnList.size() == 0) {
            returnList.add(new ArrayList<Field>());
        }

        for (int i = 0; i < returnList.size(); i++) {
            returnList.get(i).add(0, input);
        }
        return returnList;
    }

    private boolean findJumpPiece(Field field) throws
    InterruptedException, IOException, NoKingLeft {
        List<List<Field>> jumpList = new ArrayList<List<Field>>();
        jumpList = jumpSequence(field, false,
                field.getPieceOnField().isCrowned);
        checkersBoard.resetVisited();
        for (int i = 0; i < jumpList.size(); i++) {
            List<Field> tempList = jumpList.get(i);
            Field desField = tempList.get(tempList.size() - 1);
            if (!checkersBoard.isFieldEmptyOnBoard(desField.x, desField.y)) {
                checkersBoard.movePieceInRepresentation(field, desField, false);
                int stopj = tempList.size() - 1;
                for (int j = 0; j < stopj; j++) {
                    Field tempfield = tempList.get(j);
                    Field tempfield2 = tempList.get(j + 1);
                    Field takenField = checkersBoard.myBoard
                            [(tempfield.x + tempfield2.x) / 2]
                                    [(tempfield.y + tempfield2.y) / 2];
                    checkersBoard.movePieceInRepresentation(takenField,
                            trashField, false);
                }
                return true;
            }
        }
        return false;
    }

    public final void checkForUpgradeKing(Field field, boolean isSimulated)
            throws NoKingLeft, IOException {
        if (checkersBoard.peasentIsOnEndRow(field)) {
            if (checkersBoard.checkAllegiance(field, false)) {
                field.getPieceOnField().color = checkersBoard.myKingColor;
                field.getPieceOnField().isCrowned = true;
                if (!isSimulated) {
                    fieldToCheck = field;
                }
            } else {
                if (isSimulated) {
                    field.getPieceOnField().color =
                            checkersBoard.opponentKingColor;
                    field.getPieceOnField().isCrowned = true;
                } else {
                    boolean foundOne = false;
                    int i = 0;
                    while (!foundOne) {
                        if (i > 7) {
                            throw new custom.Exceptions.NoKingLeft();
                        }
                        if (!checkersBoard.kingPlace[i].isEmpty()) {
                            //Move old piece to trash
                            remoteFunctions.trashPieceOnField(field);
                            //Insert king at location
                            remoteFunctions.doMove(new Move(
                                    checkersBoard.kingPlace[i], field, true));
                            foundOne = true;
                        }
                        i++;
                    }
                }
            }
        }
    }

    //Function to check if user have replaced the
    //robots peasant piece with a king piece
    public final void checkRobotPieceReplaced() throws IOException {
        if (fieldToCheck != null) {
            boolean checkCondition = true;
            while (checkCondition) {
                if (getColor(fieldToCheck.x, fieldToCheck.y)
                        == checkersBoard.myKingColor) {
                    checkCondition = false;
                    fieldToCheck = null;
                } else {
                    checkersBoard.informer.myKingNotPlaced();
                    remoteFunctions.waitForRedButton();
                }
            }
        }
    }

    //Sets the colors of the pieces of the robot
    public final void findMyColors() throws InterruptedException, IOException {
        char test = getColor(0, 1);
        checkersBoard.myPeasentColor = getColor(0, 1);
        if (checkersBoard.myPeasentColor == 'r') {
            checkersBoard.myKingColor = 'b';
        } else if (checkersBoard.myPeasentColor == 'w') {
            checkersBoard.myKingColor = 'g';
        } else {
            remoteFunctions.resetMotors();
            remoteFunctions.initColorSensor();
            findMyColors();
        }
    }

    //Returns the color on the given position
    public final char getColor(int x, int y) throws IOException {
        com.CustomClasses.Color colorResult = remoteFunctions.getColorOnField(x, y);

        int red = colorResult.getRed();
        int green = colorResult.getGreen();
        int blue = colorResult.getBlue();
        if (red > 230 && red < 290 && green < 130 && green > 60
                && blue < 140 && blue > 60) {
            return 'r';
         } else if (red > 230 && red < 285 && green > 235 && green < 285
                && blue > 230 && blue < 280) {
            return 'w';
        } else if (red < 230 && red > 170 && green > 210 && green < 290
                && blue < 230 && blue > 170) {
            return 'g';
        } else if (red < 170 && red > 110 && green < 240 && green > 180
                && blue > 210 && blue < 270) {
            return 'b';
        } else {
            return ' ';
        }
    }

    public final boolean checkForGameHasEnded(boolean isHumansTurn) {
        switch (gameHasEnded(isHumansTurn)) {
        case 0:
            return false;
        case 1:
            checkersBoard.informer.humanWon();
            return true;
        case 2:
            checkersBoard.informer.robotWon();
            return true;
        case 3:
            checkersBoard.informer.draw();
            return true;
        default:
            return false;
        }
    }

    /*returns 0 if game has not ended, 1 if the human won,
     * 2 if the robot won and 3 if it was a draw*/
    public final int gameHasEnded(boolean humanTurn) {
        checkersBoard.updateMoveables();

        List<Piece> humanPieceList = new ArrayList<Piece>();
        List<Piece> robotPieceList = new ArrayList<Piece>();
        boolean robotHasMovable = false;
        boolean humanHasMovable = false;

        for (Field[] f : checkersBoard.myBoard) {
            for (Field field : f) {
                if (!field.isEmpty()) {
                    if (checkersBoard.checkAllegiance(field, true)) {
                        humanPieceList.add(field.getPieceOnField());
                        if (field.getPieceOnField().isMoveable) {
                            humanHasMovable = true;
                        }
                    }
                    if (checkersBoard.checkAllegiance(field, false)) {
                        robotPieceList.add(field.getPieceOnField());
                        if (field.getPieceOnField().isMoveable) {
                            robotHasMovable = true;
                        }
                    }
                }
            }
        }

        if (robotPieceList.size() == 0 || (!humanTurn && !robotHasMovable)) {
            return 1;
        }
        if (humanPieceList.size() == 0 || (humanTurn && !humanHasMovable)) {
            return 2;
        }
        if (robotPieceList.size() == 1 && humanPieceList.size() == 1) {
            if (robotPieceList.get(0).isCrowned
                    && humanPieceList.get(0).isCrowned) {
                if (humanTurn) {
                    if (isOnDoubleCorners(humanPieceList.get(0))
                            && isNearDoubleCorners(robotPieceList.get(0))
                            && !hasTheMove(true)) {
                        return 3;
                    }
                } else {
                    if (isOnDoubleCorners(robotPieceList.get(0))
                            && isNearDoubleCorners(humanPieceList.get(0))
                            && !hasTheMove(false)) {
                        return 3;
                    }
                }
            }
        }
        return 0;
    }

    private boolean hasTheMove(boolean humansTurn) {
        int rowToCheck = 0;

        if (!humansTurn) {
            rowToCheck = 1;
        }

        int pieceCount = 0;

        for (int i = rowToCheck; i < 8; i += 2) {
            for (int j = 0; j < 8; j++) {
                if (!checkersBoard.myBoard[i][j].isEmpty()) {
                    pieceCount++;
                }
            }
        }

        if (pieceCount % 2 == 1) {
            return true;
        }
        return false;
    }

    private boolean isOnDoubleCorners(Piece piece) {
        if ((piece.getX() == 0 && piece.getY() == 1)
                || (piece.getX() == 1 && piece.getY() == 0)
                || (piece.getX() == 7 && piece.getY() == 6)
                || (piece.getX() == 6 && piece.getY() == 7)) {
            return true;
        }
        return false;
    }

    private boolean isNearDoubleCorners(Piece piece) {
        if ((piece.getX() == 1 && piece.getY() == 2)
                || (piece.getX() == 2 && piece.getY() == 1)
                || (piece.getX() == 6 && piece.getY() == 5)
                || (piece.getX() == 5 && piece.getY() == 6)
                || (piece.getX() == 2 && piece.getY() == 3)
                || (piece.getX() == 3 && piece.getY() == 2)
                || (piece.getX() == 4 && piece.getY() == 5)
                || (piece.getX() == 5 && piece.getY() == 4)) {
            return true;
        }
        return false;
    }

}
